import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import styles from './Navbar.module.css';

class Navbar extends Component {
    constructor(props) {
        super(props);
        this.name = props.userName;
        this.auth = props.auth;
    }
    componentDidUpdate(prevProps) {
        if (this.props.userName !== prevProps.userName) {
            this.nameHandler();
            this.props.history.push('/');
        }
    }
    saveCat = (name, image) => {
        fetch('/create', {
            method: 'POST',
            body: JSON.stringify({
                name: name,
                image: image
            }),
            headers: {"Content-Type": "application/json"}
        });
    }

    create = () => {
        fetch('/create-user', {
            method: 'POST'
        })
        .then(res => console.log(res));
    }

    render() {
        return (
            <nav className={styles.Navbar}>
                <div className={styles.homeBtn}>
                    <Link to={'./'}>
                        <button className={styles.NavbarBtn}>
                            home
                        </button>
                    </Link>
                </div>
                <button className={styles.NavbarBtnName}>
                    {this.name == null ? null : <span>Hello, {this.name}</span>}
                </button>
                <div className={styles.OptionBtns}>
                    <Link to={'./list'}>
                        <button className={styles.NavbarBtn}>
                            My List
                        </button>
                    </Link>
                    <Link to={'./latestBlog'}>
                        <button className={styles.NavbarBtn}>
                            saveCat
                        </button>
                    </Link>
                    <Link to={'./users'}>
                        <button className={styles.NavbarBtn}>
                            My User
                        </button>
                    </Link>
                    <Link to={'./Contact'}>
                        <button className={styles.NavbarBtn}>
                            Contact Me
                        </button>
                    </Link>
                    <button onClick={() => this.saveCat("Bass Creek", "https://placeimg.com/640/480/nature")} className={styles.NavbarBtn}>
                        Create
                    </button>
                </div>
            </nav>
        )
    }
}

export default Navbar
